                <div class="mt-10 whitespace-normal">
                    Kantor BPCB Kalimantan berdiri berdasarkan Surat Menteri Pendayagunaan Aparatur
                    Negara Nomor B/2479/M.PAN/2008 tanggal 21 Agustus 2008 dan Peraturan Menteri
                    Kebudayaan dan Pariwisata Nomor PM 35 /HK.001/MKP-2008 tanggal 9 September 2008.
                    Wilayah kerjanya meliputi 5 provinsi di Kalimantan, yaitu Provinsi Kalimantan
                    Barat, Kalimantan Selatan, Kalimantan Tengah, Kalimantan dengan nama Balai
                    Pelestararian peninggalan Purbakala Samarinda.
